import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/navigation';
import { Navigation, Autoplay } from 'swiper/modules';

const services = [
  { title: 'New in Canada', desc: 'Arrival guide and newcomer essentials', path: '/services/new-to-canada' },
  { title: 'Airport Pickup & Settlement Help', desc: 'Smooth landing and support from day 1', path: '/services/airport-pickup-settlement-help' },
  { title: 'Housing Assistance', desc: 'Shared rooms, rental tips, and landlord advice', path: '/services/housing-assistance' },
  { title: 'SIN, Bank, ID Setup', desc: 'Documents and accounts made easy', path: '/services/sin-bank-id-setup' },
  { title: 'Student Support', desc: 'Colleges, PGWP, study visa help', path: '/services/student-support' },
  { title: 'Job Connection', desc: 'Resumes, job boards, and referrals', path: '/services/job-connection' },
  { title: 'Community Support', desc: 'Meetups, culture and connection', path: '/services/community-support' },
  { title: 'Language Support', desc: 'IELTS prep, French and translation', path: '/services/language-support' },
  { title: 'Nepali Directory', desc: 'Shops, food, services near you', path: '/services/nepali-directory' },
  { title: 'Legal/Immigration Help', desc: 'PR pathway, lawyers and resources', path: '/services/legal-immigration-help' }
];

export default function Dashboard() {
  const navigate = useNavigate();

  return (
    <div className="bg-gray-50 min-h-screen font-sans">
      {/* Top bar */}
      <div className="bg-white shadow p-4 flex justify-between items-center sticky top-0 z-10">
        <h1 className="text-2xl font-bold text-blue-700">ConnectingNepali</h1>
        <button
          onClick={() => {
            localStorage.clear();
            navigate('/');
          }}
          className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
        >
          Logout
        </button>
      </div>

      {/* Welcome Section */}
      <div className="bg-blue-100 text-center py-10 px-6">
        <h2 className="text-3xl font-bold text-gray-800 mb-2">Welcome, Nepali Immigrants!</h2>
        <p className="text-gray-700 text-lg">Explore essential services, support, and opportunities across Canada.</p>
      </div>

      {/* Promo Slider Section */}
      <div className="bg-emerald-900 text-white rounded-2xl my-10 mx-6 p-6 md:flex items-center justify-between shadow-lg overflow-hidden">
        <div className="flex-1 mr-6">
          <h2 className="text-3xl font-bold mb-2">Shop sneakers with confidence</h2>
          <p className="mb-4 text-white/90">See the tick, know it's backed by Authenticity Guarantee.</p>
          <button className="bg-white text-emerald-900 px-5 py-2 rounded-full hover:bg-gray-100">Browse now</button>
        </div>

        <div className="flex-1 max-w-md">
          <Swiper
            spaceBetween={20}
            slidesPerView={1}
            autoplay={{ delay: 3000 }}
            navigation
            modules={[Navigation, Autoplay]}
            loop
          >
            {['shoe1.png', 'shoe2.png', 'shoe3.png'].map((img, index) => (
              <SwiperSlide key={index}>
                <div className="bg-white p-3 rounded-xl flex justify-center items-center h-48 shadow-md">
                  <img
                    src={`/images/${img}`}
                    alt={`Sneaker ${index + 1}`}
                    className="object-contain h-full w-auto"
                  />
                </div>
              </SwiperSlide>
            ))}
          </Swiper>
        </div>
      </div>
{/* Our Services Section */}
<div className="px-6 py-10 bg-white">
  <h2 className="text-2xl font-bold text-gray-800 mb-6">Our Services</h2>

  <div className="flex space-x-4 overflow-x-auto no-scrollbar pb-4">
    {[
      { icon: 'âœˆï¸', title: 'Airport Pickup' },
      { icon: 'ðŸ ', title: 'Housing Help' },
      { icon: 'ðŸ’¼', title: 'Job Board' },
      { icon: 'ðŸ“š', title: 'Student Support' },
      { icon: 'ðŸ†”', title: 'SIN & ID Setup' },
      { icon: 'ðŸ›ï¸', title: 'Nepali Stores' },
      { icon: 'ðŸ“„', title: 'Legal Help' },
      { icon: 'ðŸ—£ï¸', title: 'Language Prep' },
      { icon: 'ðŸ¤', title: 'Community' }
    ].map((item, i) => (
      <div
        key={i}
        className="flex-shrink-0 w-36 bg-gray-50 rounded-xl shadow p-4 flex flex-col items-center justify-center text-center hover:shadow-md transition"
      >
        <div className="text-3xl mb-2">{item.icon}</div>
        <h4 className="text-sm font-semibold text-gray-700">{item.title}</h4>
      </div>
    ))}
  </div>
</div>




    </div>
  );
}
